            background: black;
            color: white;

            flex-direction: column;
            position: relative;
            font-family: 'Poppins', sans-serif;

            font-size: 16px;

            display: inline-block;
            padding: 12px 24px;
            background: blue;
            color: white;
            text-decoration: none;
            border-radius: 5px;
            transition: background 0.3s;
            font-weight: 600;
        }
        .btn:hover {
            background: darkblue;
        }
    </style>
</head>
